/*
    This shader calculates the photon trajectories of a Schwarzschild black hole analytically, 
    and finds intersections with quick root solvers.
    It solves the radially symmetric u(phi) = 1/r(phi) polynomial for the Binet differential equation:
    u(phi)'' = -u(phi) + 3/2 *R_sch * u(phi)^2


