//NOTE:
//In case you have a better GPU, try commenting out the
//   fewerStars     define    in BufferA for more stars
//or if slow, use smaller nDegree below

#define PI 3.14159265
//Schwarzschild radius
#define RS 1.0
//polynomial degree+1, nDegree=16 is extremely puncual, 
// 8 is usually enough for a fullHD render. The difference is mainly at the photon sphere.
// I plan to rewrite the storage and calculations to use vec4[2] instead of float[nDegree]
#define nDegree 8
//The maximal number of steps. Each step is a 1 radian distance in the u(phi)=1/r(phi) trajectory. 
//Most rays don't need more than 3, 60 means ten revolutions around the black hole
#define MAX_STEPS 60


struct light_params{
    float u0;
    float dudphi0;
    float alpha;
    vec3 r_hat;
    vec3 r_perp;
};


light_params startParams(in vec3 ro, in vec3 rd){
    float u0 = 1.0/length(ro);
    vec3 r_hat = normalize(ro);
    vec3 v_hat = normalize(rd);
    vec3 r_perp = normalize(v_hat - dot(r_hat, v_hat)*r_hat);
    float alpha = acos(dot(r_hat, v_hat));
    float dudphi0 = -1.0/tan(alpha)*u0;

    return light_params( u0, dudphi0, alpha, r_hat, r_perp  );
}


//polynomial Solution to the Binet differential equation for the Schwarzschild metric for zero mass objects
//u''(phi) = - u + 3/2 * RS * u*u
void calcWeierstrass(inout float coeff[nDegree], in float u0, in float dudphi0){
    coeff[0] = u0;
    coeff[1] = dudphi0;
    for(int index=0; index<nDegree-2; index++){
        float csum = 0.0;
        for(int i=0; i<=index; i++ ){
            csum += coeff[i]*coeff[index-i];
        }
        coeff[index+2] = (-coeff[index] + 1.5*RS*csum)/float( (index+1)*(index+2)   );
    }
}

//evaluate polynomial segment at deltaPhi angle, using the Horner's quick poly method
float evalPoly(in float v[nDegree], in float deltaPhi){
    float res = v[nDegree-1];
    for(int i=nDegree-2; i>=0; i--){
        res = v[i] + deltaPhi*res;
    }
    return res;
}

//evaluate once derivated polynomial segment at deltaPhi angle, using the Horner's quick poly method
float evalDerivPoly(in float v[nDegree], in float deltaPhi){
    float res = float(nDegree-1)*v[nDegree-1];
    for(int i=nDegree-2; i>=1; i--){
        res = float(i)*v[i] + deltaPhi*res;
    }
    return res;
}




//Newton iteration to find u(phi) = 0 root
//vec2 output for debugging
//phi should be around the working point of the polynomial
float skyEventSolver(in float coeff[nDegree],in float local_phi_guess){
    int i=0;
    float relDelta = 1e5;
    //float u;
    while(i<5 && relDelta>1e-5){
        //u = evalPoly(coeff, local_phi_guess);
        //float delta = -u/evalDerivPoly(coeff, local_phi_guess);
        float delta = -evalPoly(coeff, local_phi_guess)/evalDerivPoly(coeff, local_phi_guess);
        local_phi_guess += clamp(delta, -0.1, 0.1); //clamping for the rare cases, so it does not jump out of the work region
        relDelta = abs(delta/local_phi_guess);
        i++; //this was missing before :(
    }

    //return vec2(local_phi_guess, u); // u should be around zero 
    return local_phi_guess; // u should be around zero 
}

//Newton iteration to find u(phi) = 1 root
//vec2 output for debugging
float eventHorizonEventSolver(in float coeff[nDegree],in float local_phi_guess){
    int i=0;
    float relDelta = 1e5;
    //float u;
    while(i<5 && relDelta>1e-5){
        //u = evalPoly(coeff, local_phi_guess);
        //float delta = -(u-1.0)/evalDerivPoly(coeff, local_phi_guess);
        float delta = -(evalPoly(coeff, local_phi_guess)-1.0)/evalDerivPoly(coeff, local_phi_guess);
        local_phi_guess += clamp(delta, -0.1, 0.1);
        relDelta = abs(delta/local_phi_guess);
        i++; //this was missing before :(
    }

    //return vec2(local_phi_guess, u); // u should be around 1.0
    return local_phi_guess;
}

//this evaluates the polynomial at phi=1.0
float sum(in float v[nDegree]){
    float s = 0.0;
    for(int i=0; i!= nDegree; i++){
        s+=v[i];
    }
    return s;
}

//this evaluates the derivative of the polynomial at phi=1.0
float dsum(in float v[nDegree]){
    float s = 0.0;
    for(int i=1; i!= nDegree; i++){
        s+=float(i)*v[i];
    }
    return s;
}

//disk is at z=0, all we need to do is 
//solving (r_hat_z * cos(phi) + r_perp_z*sin(phi)) = 0 for phi
//it is based on the trigonometric identity
//cos(phi)*cos(alpha) +- sin(phi)*sin(alpha) = cos(phi -+ alpha) = 0
//we don't need to know the r(phi) trajectory/geodetic 
float diskEventSolver(in float r_hat_z, in float r_perp_z){
    vec2 a = normalize(vec2(r_hat_z,r_perp_z));
    float alpha = atan(a.x, a.y); //the normalization is not necessary
    if (alpha >0.0) alpha-=PI; //the disk events are periodic in phi, we need one in front of us, phi>0
    if (alpha >0.0) alpha-=PI;
    float phi = -alpha; 
    return phi;

}


float PHI = 1.61803398874989484820459;  // Î¦ = Golden Ratio   

float gold_noise(in vec2 xy, in float seed){
       return fract(tan(distance(xy*PHI, xy)*seed*333.992+1.597)*xy.x+0.88678676);
}

#define SEED 1.1056
float backgroundStars(in vec2 uv){

    float bg =  gold_noise(  vec2(gold_noise( uv ,SEED + 53.2343), gold_noise( uv ,2.223*SEED + 0.2343423434)), 225.45*SEED + 0.75722)   ;
    bg += 0.01*sin(uv.x*1.3 + 0.1) + 0.01*sin(uv.y*6.3 + 0.1);
    return pow(bg , 55.0);
}

vec3 integrateRay(in light_params photon,in float real_vs_sim){
   float coeffs[nDegree];
   //float old_coeffs[nDegree];
   float u0 = photon.u0;
   float dudphi0 = photon.dudphi0;
   float phi_approx = 1e5;

   float disk_phi = diskEventSolver(photon.r_hat.z, photon.r_perp.z);
   vec3 color = vec3(0.0,0.0,1.0);
   vec3 color_real = vec3(0.0,0.0,1.0);
   int i=0;
   vec3 disk_color = vec3(0.0, 0.0, 0.0);
   vec3 disk_color_real = vec3(0.0, 0.0, 0.0);

   int n_disk_passes = 0;
   int n_disk_passes_real = 0;
   const float blending_factor = 0.6;
   while(i<=MAX_STEPS && phi_approx>1e4){
       calcWeierstrass( coeffs, u0, dudphi0 );

       float u1 = sum(coeffs);
       float dudphi1 = dsum(coeffs);
       if(sign(u0)!=sign(u1) && u0>0.0 && u0 < 1.0){
           //sky event          
           phi_approx = -u0/(u1-u0) ;//+ float(i);
//#ifdef USE_NEWTON_REFINE
           phi_approx = skyEventSolver(coeffs, phi_approx);
//#endif
           phi_approx += float(i);
           vec3 iDir = (photon.r_hat*cos(phi_approx) + photon.r_perp*sin(phi_approx));
           float alpha = atan(iDir.x, iDir.y);
           float beta = acos(iDir.z/length(iDir));
           float shade =     mod(floor(alpha/PI*40.0) + floor(beta/PI*40.0),2.0); 
           color_real = texture(iChannel0,vec2(alpha/PI/2.0 +0.5, beta/PI)).rgb;
           color = (shade * vec3(0.1, 0.1, 0.1) + (1.0-shade)*vec3(0.15,0.15,0.15));

       }
       if(sign(u0-1.0)!=sign(u1-1.0) && u0>0.0 && u0<1.0){
           //event horizon event

           float phi_approx_eh = -(u0-1.0)/(u1-u0);
           phi_approx_eh = eventHorizonEventSolver(coeffs, phi_approx_eh); //Refining the event horizon is not really necessary if it is black
           phi_approx_eh += float(i);
           if(phi_approx_eh<phi_approx){
               vec3 iDir = (photon.r_hat*cos(phi_approx_eh) + photon.r_perp*sin(phi_approx_eh));

               float alpha = atan(iDir.x, iDir.y);
               float beta = acos(iDir.z/length(iDir));
               float shade =  mod(floor(alpha/PI*8.0) + floor(beta/PI*8.0),2.0); 
               phi_approx = phi_approx_eh;

               color = shade * vec3(0.3, 0.0, 0.0) + (1.0-shade)*vec3(0.2,0.2,0.0);
               color_real = vec3(0.0, 0.0, 0.0);
            }
       }
       //phi_approx is the endpoint of the trajectory
       if( float(i)<=disk_phi && float(i+1)>disk_phi && disk_phi < phi_approx ){
           float u_disk = evalPoly(coeffs,disk_phi - float(i));

           if(1.0/u_disk>3.0 && 1.0/u_disk<100.0){
               vec3 iDir = (photon.r_hat*cos(disk_phi) + photon.r_perp*sin(disk_phi));
               float alpha = atan(iDir.x, iDir.y);


               if( 1.0/u_disk<7.0){
                   float shade =  mod(floor(1.0/u_disk) + floor(alpha/PI*10.0),2.0); 
                   disk_color = 0.9*disk_color + shade * vec3(0.7 ,.7 ,.4) + 
                                     (1.0-shade)*vec3(0.01, 0.01, 0.9)  ;
                           //.0-blending_factor)*disk_color + 
                           //      blending_factor*( shade * vec3(0.7 ,.7 ,.4) + 
                           //          (1.0-shade)*vec3(0.01, 0.01, 0.9)  );
                   n_disk_passes++;
               }
               disk_color_real += 2.0*exp(-0.15/u_disk + 0.36)* abs(texture(iChannel1,vec2((1.0/u_disk-3.0)/7.0, 0.99*abs(alpha+PI)/2.0/PI +0.001 )).rgb);
               n_disk_passes_real++;
           }
           disk_phi += PI; //the next disk event will be PI radian degrees further
       }

       i++;
       u0 = u1;
       dudphi0 = dudphi1;
   }
//   if(n_disk_passes==0){
//       return color;
       //return mix(color, color_real, real_vs_sim);
//   } else {
       //float two_power = 1.0/float(1 << n_disk_passes);
       //color = two_power*color + (1.0-two_power)*disk_color;
       if(n_disk_passes!=0){
           float blending_power = pow(blending_factor, float(n_disk_passes));
           color = blending_power*disk_color + (1.0 - blending_power)*color;
           color+=disk_color;
       }
       color_real += disk_color_real;
       return mix(color, color_real, real_vs_sim);
  // }
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    //added a small const, so the accreation disk is never seen from the edge    
    vec2 mouse = -vec2(iMouse.x/iResolution.x * 2.0*PI  ,
                        PI*iMouse.y/iResolution.y + PI/2.0+0.01); 
     // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;
    float screen_ratio = iResolution.y/iResolution.x;
    vec3 randSeed = vec3(uv, iTime);

    //float psy = 0.7;
    //float phi = iTime/2.0;
    float rot_phi = mod(iTime/6.0, 2.0*PI);
    float rot_psy = sin(iTime*0.1);
    float distance = sin(iTime/3.0)*12.0+ 15.0;
    float psy = mouse.y + rot_psy;
    float phi = mouse.x + rot_phi;
    float camDist = 10.0;
    float invFOV = 0.5;
	vec3 ro = vec3(distance, 0.0, 0.0);
    vec3 rd=normalize(vec3(-invFOV,
            uv.x - 0.5 , 
            screen_ratio*(0.5-uv.y )
            ));

    mat3 rotationYZ = mat3(cos(psy), 0.0, -sin(psy),
                             0.0, 1.0, 0.0,   
                         sin(psy), 0.0, cos(psy) );
    mat3 rotationXZ = mat3( cos(phi), -sin(phi),0.0,                             
                            sin(phi), cos(phi), 0.0,
                            0.0, 0.0, 1.0);


    ro = rotationXZ*rotationYZ *ro;
    rd = rotationXZ*rotationYZ *rd;
    float real_vs_sim = smoothstep(0.5, 1.5,   abs(phi) );   
    vec3 cg = integrateRay(startParams(ro, rd), real_vs_sim);
    float alpha = atan(rd.x, rd.y);
    float beta = acos(rd.z); // divide rd.z by rd_norm if necessary
    //float shade = (int(np.floor(alfa/np.pi*40) + np.floor(beta/np.pi*40)) % 2 == 1)
    float shade =     mod(floor(alpha/PI*40.0) + floor(beta/PI*40.0),2.0);
    // Output to screen

    //vec3 color = shade * vec3(0.1, 0.1, 0.1) + (1.0-shade)*vec3(0.15,0.15,0.15);
    fragColor = vec4(cg,1.0);
}

struct specks{
    vec2 pos; //start pos polar coordinates, r-3.0, phi/2/PI
    vec2 width; //length in polar coordinates
    vec3 color;
};

float lineSDF(in vec2 point, in vec2 start, in vec2 end){
    vec2 line = end-start;
    vec2 p2s = point-start;
    float affine = clamp( dot(p2s, line)/dot(line, line), 0.0, 1.0);
    return length(p2s - affine*line);
}

#define NOBJ 8
vec3 diskIntegral( in vec2 fragCoord ){
    vec2 uv = fragCoord/iResolution.xy; 

    specks[NOBJ] objs = specks[NOBJ](
        specks(vec2( 0.1, 0.6  ), vec2(0.1, 0.7) , 0.4*vec3(0.2, 1.0, 0.0)),
        specks(vec2( 0.2, 0.2  ), vec2(0., 0.5), vec3(1.0, 1.0, 1.0) ),
        specks(vec2( 0.34, 0.8  ), vec2(0.0,0.95) , 0.4*vec3(1.0, 1.0, 1.0)),
        specks(vec2( 0.6, 0.7  ), vec2(0., 0.8) , 0.2*vec3(1.0, 1.0, 0.0)),
        specks(vec2( 0.73, 0.1  ), vec2(0., 0.9) , 0.6*vec3(1.0, 1.0, 0.4)),
        specks(vec2( 0.75, 0.1  ), vec2(0., 1.0) , 0.3*vec3(1.0, 1.0, 1.0)),
        specks(vec2( 0.83, 0.8  ), vec2(0.01, 0.7) , 0.6*vec3(0.2, 0.2, 0.0)),
        specks(vec2( 0.9, 0.0  ), vec2(0., 0.94) , 0.5*vec3(1.0, 1.0, 1.0))

    );
    vec3 color = vec3(1.0);
    for(int i=0; i<NOBJ; i++){

        float dist = lineSDF( uv, objs[i].pos, objs[i].pos + objs[i].width );
        float ampl = exp( -20.0*dist );
        dist = lineSDF( vec2(uv.x, uv.y+1.0), objs[i].pos, objs[i].pos + objs[i].width );
        ampl += exp( -20.0*dist );
        dist = lineSDF( vec2(uv.x, uv.y-1.0), objs[i].pos, objs[i].pos + objs[i].width );
        ampl += exp( -20.0*dist );
        color -= ampl*objs[i].color;
    }

    return color;
}


